import "./navbar.css"

const Navbar = () => {
    return (
        <div className="navbar">
        <span className="logo">Black Lit App</span>
        <ul className="list">
            <li className="listItem">
                <img src="" alt="" className="avatar" />
            </li>
            <li className="listItem">Dante Noir</li>
            <li className="listItem">Logout</li>
        </ul>
    </div>
    )
};

export default Navbar;
